import React from 'react';

export default function Welcome({ name, topic = 'Web Development' }) {
  const infoPassed = name && topic;

  return infoPassed ? (
    <h1>
      Welcome, {name}! We hope you learn a lot about {topic}.
    </h1>
  ) : (
    <span>Hey there!</span>
  );
}
